content=Now my charms are all o'erthrown, / And what strength I have's mine own, / Which is most faint: now, 'tis true, / I must be here confined by you... / But release me from my bands / With the help of your good hands: / Gentle breath of yours my sails / Must fill, or else my project fails, / Which was to please: now I want / Spirits to enforce, art to enchant; / And my ending is despair, / Unless I be relieved by prayer

